pm.test("Late fee should be calculated correctly", function () {
    const jsonData = pm.response.json();
    const { daysLate } = jsonData;

    let correctLateFee = 0;
    if (daysLate <= 5) {
        correctLateFee += daysLate * 1000;
    } else {
        correctLateFee += 5 * 1000;
    }

    if (daysLate > 5) {
        correctLateFee += (daysLate - 5) * 2000;
    }

    pm.expect(jsonData.lateFee).to.eql(correctLateFee);
});

